webpackJsonp([0x82a075183f3b],{657:function(e,a){e.exports={data:{allMarkdownRemark:{totalCount:1,edges:[{node:{fields:{slug:"/metadata-propaganda"},excerpt:"There has been a lot of talk recently about Russia and potential interference with the US presidential election. I don’t know if this is…",timeToRead:1,frontmatter:{title:"Metadata propaganda",tags:["analytics","data","trump","russia"],cover:"https://unsplash.it/1152/300/?random?Russia",date:"2016-12-30T19:05"}}}]},authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{tag:"trump",nodes:[{node:{frontmatter:{title:"Metadata propaganda",tags:["analytics","data","trump","russia"],cover:"https://unsplash.it/1152/300/?random?Russia",date:"2016-12-30T19:05",author:"eddie"},fields:{slug:"/metadata-propaganda"},html:'<p>There has been a lot of talk recently about Russia and potential interference with the US presidential election. I don’t know if this is true; I suspect it is, but it’s not my place to say. What I do know is I’ve started to see a lot of odd data reported by Google Analytics; mainly pro-Trump messages set as peoples browser languages…</p>\n<p><img src="/images/analytics-languages.png" alt="Google Analytics Languages"></p>\n<p>Where does this traffic originate? Russia. I post nothing in Russian, I have no genuine Russian readers that I know of. But Google Analytics reports nearly all of this data from there.</p>\n<p><img src="/images/analytics-countries.png" alt="Google Analytics Countries"></p>\n<p>No conclusions can really be drawn from this, but it’s interesting regardless.</p>',timeToRead:1}}],page:1,pages:1,total:1,limit:5}}}});
